import React from 'react';
import './HomePage.css';
import SimpleImageSlider from "react-simple-image-slider";
export default function App() {
    const sliderImages = [
        {
            url:"images/slider2.jpg",
        },
        {
            url:"images/slider1.jpg",
        },
        {
            url:"images/slider3.jpg",
        },
    ];
    return (
        <div className="home">
            <div className="banner">
                <SimpleImageSlider
                    width={1000}
                    height={250}
                    images={sliderImages}
                    showNavs={true}
                />
            </div>
        </div>
    );
}
